embedfield:
Return document in each group with max value using MongoDB<p>Given a dataset:</p>

<pre><code>{_id: 0, type: 'banana', amount: 5}
{_id: 1, type: 'banana', amount: 3}
{_id: 2, type: 'apple', amount: 8}
{_id: 3, type: 'apple', amount: 2}
</code></pre>

<p>What is the most efficient way of getting only the records of the same <code>type</code>, that has the highest <code>amount</code>?</p>

<p>The expected result is:</p>

<pre><code>{_id: 0, type: 'banana', amount: 5}
{_id: 2, type: 'apple', amount: 8}
</code></pre>

<p>Right now I'm doing it this way, but it seems kinda silly:</p>

<pre><code>collection.aggregate([
  { $sort: { 'amount': -1 } },
  { $group: {
     _id: '$type',
     group: {
       $push: '$$ROOT'
     }
   }, {
     $replaceRoot: {
       newRoot: { $arrayElemAt: ["$group", 0] }
     }
   }
])
</code></pre>

