How do you save to three collections at once?<p>I'm building my first mean stack app.  It's a review site that contains three models:  User, Review, and Company.</p>

<p>When I make a review, I want the new review to be saved to the 'review' collection, and for that review to be connected by reference to the company being reviewed and the user who wrote the review.  I also want the user to hold a reference to the review, and the company to hold a reference to all the reviews it has.  Here are my models:  </p>

<p><b> Review </b></p>

<pre><code>const mongoose = require("mongoose");
const Schema = mongoose.Schema;

const reviewSchema = new Schema ({

  companyName: String,
  companyId: { type: Schema.Types.ObjectId, ref: 'Company'},
  starRating: Number,
  subject: String,
  commentBody: String,
  createdBy: { type: Schema.Types.ObjectId, ref: 'User'},

});


const Review = mongoose.model("Review", reviewSchema);
module.exports = Review;
</code></pre>

<p><b> Company </b></p>

<pre><code>const mongoose = require("mongoose");
const Schema = mongoose.Schema;

const companySchema = new Schema ({

  companyName: String,
  about: String,
  basedIn: String,
  materialOrigins: [String],
  productRange: [String],
  category: String,
  reviews: [ {type: Schema.Types.ObjectId, ref: 'Review'} ],
  socialRating: Number,
  environmentalRating: Number,
  priceRange: Number

});


const Company = mongoose.model("Company", companySchema);
module.exports = Company;
</code></pre>

<p><b> User </b></p>

<pre><code>const mongoose = require("mongoose");
const Schema = mongoose.Schema;

const userSchema = new Schema ({
  email: String,
  firstName: String,
  lastName: String,
  password: String,
  image: Object,
  aboutText: String,
  reviews: [ { type: Schema.Types.ObjectId, ref: "Review" } ]
  // comments: { type: Schema.Types.ObjectId, ref: 'Comment' }

});

const User = mongoose.model("User", userSchema);
module.exports = User;
</code></pre>

<p>This is my current route, which currently saves the review to the collection and attaches the user.  However, the user doesn't get the review.  </p>

<p><b> route </b> </p>

<pre><code>router.post('/:category/:company', (req, res) =&gt; {

  var subject = req.body.subject;
  var commentBody = req.body.commentBody;
  var starRating = req.body.starRating;
  var userId = req.body.userId;

  if(!subject || !commentBody || !starRating) {
    res.status(400).json({ message: "Subject, comment body, and star rating are required." });
    return;
  }

  var newReview = Review({
    starRating,
    subject,
    commentBody,
    userId
  });


     User.findById(userId, {
     }, (err, user) =&gt; {
       if (err) {
         return res.send(err);
       } else {

         console.log("checking out user in route", user);
         user.reviews.push(newReview);
         user.save();

         newReview.save((err, review) =&gt; {
              if (err) {
                return res.status(400).json({ message: err });
              } else {
                res.status(200).json({ message: 'Review saved', review });
              }
            });

       }
     });
</code></pre>

<p>I haven't tried adding the company in because I'm trying to do one thing at a time.  I've been looking at 'populate', but all of the documentation seems to only use two models at once.  Is it possible to do three at once?  Or am I overcomplicating this?</p>

<p>Apologies if this is all overcomplicated.  I'm fairly new to MongoDB and MEAN stack in general.  Thanks for your help.</p>

